node.text:
I remember being afraid to go to the gym because I thought I needed a "gym body" first. I learned that fitness is not meant for looking a certain way but for being able to feel the best you can. Now I find joy in movement and can exercise with freedom from forcing my body fit some half-brained ideal based on a antiquated view of health.

We believe that healthy bodies come in all shapes and sizes! Check out some of our favorite looks for joyful movement with our #healthateverysize version of the #dontrushchallenge

These ladies inspire me every single day with their vibrant, positive energy. Make sure to follow them all and show them some love too!

